    public function getSourceContext(): Source
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Connectez-vous à votre compte{% endblock %}

{% block body %}
<div class=\"d-flex justify-content-center align-items-center vh-100\">
    <form method=\"post\" class=\"text-center\">

        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        {% if app.user %}
            <div class=\"mb-3\">
                You are logged in as {{ app.user.userIdentifier }}, <a href=\"{{ path('app_logout') }}\">Se déconnecter</a>
            </div>
        {% endif %}

        <div class=\"mb-3\">
            <label for=\"inputEmail\">Email</label>
            <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
        </div>

        <div class=\"mb-3\">
            <label for=\"inputPassword\">Mot de passe</label>
            <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>
        </div>

        <input type=\"hidden\" name=\"_csrf_token\"
               value=\"{{ csrf_token('authenticate') }}\"
        >

        <button class=\"btn btn-lg btn-primary\" type=\"submit\">
            Se connecter
        </button>
    </form>
</div>
{% endblock %}
", "security/login.html.twig", "C:\\laragon\\www\\new_circuit_court\\templates\\security\\login.html.twig");
